import React from 'react'

var Siv = ()=>{
    var title = 'React', matt = 'React is a free and open-source front-end JavaScript library for building user interfaces or UI components. It is maintained by Facebook and a community of individual developers and companies. React can be used as a base in the development of single-page or mobile applications.'
return( <>
        <h1>{title}</h1>
        <p>{matt}</p>
        <Vis/> <Sai/>
    </>
   )
}
export default Siv
var Vis = ()=>{
    var title = 'Functional Components', matt = 'Functional components are some of the more common components that will come across while working in React. These are simply JavaScript functions. We can create a functional component to React by writing a JavaScript function. ... In the functional Components, the return value is the JSX code to render to the DOM tree.'
return  (<>
        <h1>{title}</h1>
        <p>{matt}</p>
    </>
)
}

var Sai = ()=> {
    var title = 'Class Component', matt = 'A class component is a JavaScript class that extends React. Component which has a render method. ... On the other hand, when defining a class component, you have to make a class that extends React. Component . The JSX to render will be returned inside the render method'
return (<>
        <h1>{title}</h1>
        <p>Eaoastal Andhra region of Andhra Pradesh, India. Its district headquarters is at Kakinada. As of Census 2011, it became the most populous district of the state with a population of 5,151,549.</p>
    </>
    )
}
